import React from "react";
import MyName from "./MyName"


function AboutMySelf() {
    return (
        <p>
            a paragraph about my self
        </p>
    );
}
function FavoriteVacation() {
    return(
        <ul>
            <li>uno</li>
            <li>dos</li>
            <li>tres</li>
        </ul>
    );
}

function MyInfo() {
    return(
        <div>
            <MyName />
            <AboutMySelf />
            <FavoriteVacation />
        </div>
    );
}

export default MyInfo;
